webpackJsonp([0xc41ec5f5842f],{2748:function(e,a){e.exports={pathContext:{docHtml:'<h1>is-glob <a href="http://badge.fury.io/js/is-glob"><img src="https://badge.fury.io/js/is-glob.svg" alt="NPM version"></a>  <a href="https://travis-ci.org/jonschlinkert/is-glob"><img src="https://travis-ci.org/jonschlinkert/is-glob.svg" alt="Build Status"></a></h1>\n<blockquote>\n<p>Returns <code>true</code> if the given string looks like a glob pattern or an extglob pattern. This makes it easy to create code that only uses external modules like node-glob when necessary, resulting in much faster code execution and initialization time, and a better user experience.</p>\n</blockquote>\n<p>Also take a look at <a href="https://github.com/jonschlinkert/is-valid-glob">is-valid-glob</a> and <a href="https://github.com/jonschlinkert/has-glob">has-glob</a>.</p>\n<h2>Install</h2>\n<p>Install with <a href="https://www.npmjs.com/">npm</a></p>\n<pre><code class="language-sh">$ npm i is-glob --save\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var isGlob = require(\'is-glob\');\n</code></pre>\n<p><strong>True</strong></p>\n<p>Patterns that have glob characters or regex patterns will return <code>true</code>:</p>\n<pre><code class="language-js">isGlob(\'!foo.js\');\nisGlob(\'*.js\');\nisGlob(\'**/abc.js\');\nisGlob(\'abc/*.js\');\nisGlob(\'abc/(aaa|bbb).js\');\nisGlob(\'abc/[a-z].js\');\nisGlob(\'abc/{a,b}.js\');\nisGlob(\'abc/?.js\');\n//=> true\n</code></pre>\n<p>Extglobs</p>\n<pre><code class="language-js">isGlob(\'abc/@(a).js\');\nisGlob(\'abc/!(a).js\');\nisGlob(\'abc/+(a).js\');\nisGlob(\'abc/*(a).js\');\nisGlob(\'abc/?(a).js\');\n//=> true\n</code></pre>\n<p><strong>False</strong></p>\n<p>Patterns that do not have glob patterns return <code>false</code>:</p>\n<pre><code class="language-js">isGlob(\'abc.js\');\nisGlob(\'abc/def/ghi.js\');\nisGlob(\'foo.js\');\nisGlob(\'abc/@.js\');\nisGlob(\'abc/+.js\');\nisGlob();\nisGlob(null);\n//=> false\n</code></pre>\n<p>Arrays are also <code>false</code> (If you want to check if an array has a glob pattern, use <a href="https://github.com/jonschlinkert/has-glob">has-glob</a>):</p>\n<pre><code class="language-js">isGlob([\'**/*.js\']);\nisGlob([\'foo.js\']);\n//=> false\n</code></pre>\n<h2>Related</h2>\n<ul>\n<li><a href="https://www.npmjs.com/package/has-glob">has-glob</a>: Returns <code>true</code> if an array has a glob pattern. | <a href="https://github.com/jonschlinkert/has-glob">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/is-extglob">is-extglob</a>: Returns true if a string has an extglob. | <a href="https://github.com/jonschlinkert/is-extglob">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/is-posix-bracket">is-posix-bracket</a>: Returns true if the given string is a POSIX bracket expression (POSIX character class). | <a href="https://github.com/jonschlinkert/is-posix-bracket">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/is-valid-glob">is-valid-glob</a>: Return true if a value is a valid glob pattern or patterns. | <a href="https://github.com/jonschlinkert/is-valid-glob">homepage</a></li>\n<li><a href="https://www.npmjs.com/package/micromatch">micromatch</a>: Glob matching for javascript/node.js. A drop-in replacement and faster alternative to minimatch and multimatch. Just… <a href="https://www.npmjs.com/package/micromatch">more</a> | <a href="https://github.com/jonschlinkert/micromatch">homepage</a></li>\n</ul>\n<h2>Run tests</h2>\n<p>Install dev dependencies:</p>\n<pre><code class="language-sh">$ npm i -d &#x26;&#x26; npm test\n</code></pre>\n<h2>Contributing</h2>\n<p>Pull requests and stars are always welcome. For bugs and feature requests, <a href="https://github.com/jonschlinkert/is-glob/issues/new">please create an issue</a>.</p>\n<h2>Author</h2>\n<p><strong>Jon Schlinkert</strong></p>\n<ul>\n<li><a href="https://github.com/jonschlinkert">github/jonschlinkert</a></li>\n<li><a href="http://twitter.com/jonschlinkert">twitter/jonschlinkert</a></li>\n</ul>\n<h2>License</h2>\n<p>Copyright © 2015 Jon Schlinkert\nReleased under the MIT license.</p>\n<hr>\n<p><em>This file was generated by <a href="https://github.com/assemble/verb-cli">verb-cli</a> on October 02, 2015.</em></p>',docPath:"argo-ci/node_modules/is-glob/readme",proj:"argo-ci"}}}});
